import React from 'react';
import Container from './Container.js'
import SmallContainer from './SmallContainer.js'
import Header from './Header'
import H1 from './H1'
import P from './P'
import { Tertiary } from './Colors.js'
import Br from './Br'



class Create extends React.Component {
	render() {
		return(
			<Container>

				<Header width='100'>
					<H1 big>Create</H1>
				<SmallContainer width='150'><Br></Br></SmallContainer>

					<P big>Don't be a stat sheet. Be a hero.</P>
				</Header>



			</Container>
		);
	}

}

export default Create;
